import { useEffect } from 'react';
import { usePrams } from 'react-router-dom';

function EditRecipe() {

    let { id } = useParams();

    useEffect(() => {
        fetch(`http://localhost:8000/recipes/${id}`)
        .then((res) => res.json())
        .then((data) => console.log(data));
    })
    return(
        <h1>Edit recipe</h1>
    );
};

export default EditRecipe;
